55:15'),(159,'captainmarkos@gmail.com',1,'1999-11-11','','',24,20,44,'75','72',1400,600,'40','8','N','Y','Y','N','N','Y','N','N','N','Y','N','N','Balmorhea, TX','Balmorhea State Park','30','F','N','50','',20,'N','','N','','Open Water dive #2 in fresh water.  I used a 3mm full suit and remember being a little cold still.  This was an altitude dive and the formula given to me had lots of rounding (up).\n\nElevation 3150ft\n\nSo the adjusted depth came out to 50ft.\n\nI think the actual depth was ~25ft.\n\nThis was a small lake fed by an underwater spring.  There were fish and turtles.\n\nInstructor:  Julie Brensen #47445','N','2012-08-05 21:55:15'),(161,'captainmarkos@gmail.com',647,'2012-08-04','','',0,0,0,'','',0,0,'','','N','N','N','N','N','N','N','N','N','N','N','N','gggggggggg','eeeeeeeeee','','','','','',0,'N','','N','','','Y','2012-08-05 22:04:13'),(162,'captainmarkos@gmail.com',648,'2012-08-04','','',0,0,0,'','',0,0,'','','N','N','N','N','N','N','N','N','N','N','N','N','ddddddddd','vvvvvvvvvvvv','','','','','',0,'N','','N','','','Y','2012-08-05 22:04:23'),(163,'captainmarkos@gmail.com',649,'2012-08-22','','',0,0,0,'','',0,0,'','','N','N','N','N','N','N','N','N','N','N','N','N','wwwwwwwwwwww','jjjjjjjjjj','','','','','',0,'N','','N','','','Y','2012-08-05 22:04:30'),(165,'captainmarkos@gmail.com',651,'2012-08-09','','',0,0,0,'','',0,0,'','','N','N','N','N','N','N','N','N','N','N','N','N','Santa Rosa, NM','Blue Hole','','','','','',0,'N','','N','','','N','2012-08-05 21:58:55'),(166,'captainmarkos@gmail.com',652,'2012-08-06','','',0,0,0,'','',0,0,'','','N','N','N','N','N','N','N','N','N','N','N','N','Hollywood, CA','Over the Rainbow','','','','','',0,'N','','N','','','N','2012-08-05 22:02:12'),(167,'captainmarkos@gmail.com',653,'2012-08-02','','',0,0,0,'','',0,0,'','','N','N','N','N','N','N','N','N','N','N','N','N','Santa Monica, CA','Dark Cloud','','','','','',0,'N','','N','','','N','2012-08-05 22:03:53'),(168,'captainmarkos@gmail.com',650,'2012-08-06','','',0,0,